class App extends Component {
  //console.log(props);
  //const subject = props.subject;
  render(){

    return (
      <React.Fragment>
        <Router>
         <NavBar />
          <Switch>
            <Route exact path="/" component={HomePage} />
            <Route path="/about" component={About} />
            <Route path="/project" component={Project} />
          </Switch>
        </Router>
      </React.Fragment>
    );
  }
}

export default App;
